style.css:
@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document domain("bash.org") {
body{background:#222!important;color:#fff!important;
  font-family:monospace!important}
td[bgcolor],table[bgcolor] {
  color:#303!important; background:#fac!important;
  border:1px solid #111;border-width:0 1px 1px 0}
td[bgcolor] a,table[bgcolor] a {color:#303 !important}
p.quote {background:#282828!important}
p.qt {background:#181818!important;
  margin:0 0 16px 0!important;
  padding:8px 0!important;
  border:1px solid #000;
  border-bottom:1px solid #603}
a {color:#fac!important}
center:first-child table:first-child {display:none}
}
